import React from 'react';

const Header = () => {
  return (
    <header className="w-full py-4 bg-rgb(255,128,170) text-white">
      <h1 className="text-2xl font-bold text-center">BrainBolt</h1>
      <nav>
        <ul className="flex justify-center space-x-4">
          <li><a href="/login" className="hover:underline">Login</a></li>
          <li><a href="/session" className="hover:underline">Session</a></li>
          <li><a href="/techniques" className="hover:underline">Techniques</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
